properties.boundary_description:
The boundaries of the proposed Santa Clara Valley viticultural area are as follows:
(1) The beginning point is at the junction of Elephant Head Creek and Pacheco Creek (approx. .75 mile southwest
of the Pacheco Ranger Station) on the Pacheco Peak, Calif. U.S.G.S. map.
(2) From the beginning point the boundary moves in a northerly direction up Elephant Head Creek approx. 1.2
miles until it intersects the 600 foot elevation contour line;
(3) Then it meanders in a northwesterly direction along the 600 foot contour line approx. 55 miles until it intersects
Vargas Road in the northwest portion of Sec. 25, T4S/RlW on the Niles, Calif. U.S.G.S. map;
(4) Then it travels in a northwesterly direction approx. .6 mile to the intersection of Morrison Canyon Road in the
eastern portion of Sec. 23, T4S/RlW;
(5) Then it follows Morrison Canyon Road west approx. 1.5 miles to Mission Boulevard (Highway 238) at Sec. 22,
T4S/RlW;
(6) Then it moves northwest on Mission Boulevard (Highway 238) approx. .6 mile to the intersection of Mowry
Avenue just past the Sanatorium at Sec. 22, T4S/RlW;
(7) It then goes in a southwesterly direction on Mowry Avenue approx. 3.6 miles to the intersection of Nimitz
Freeway (Highway 880) (depicted on the map as Route 17) at Sec. 5, T5S/RlW, on the Newark, Calif. U.S.G.S. map;
(8) It then moves along the Nimitz Freeway (Highway 880) in a southeasterly direction for approx. 9 miles to the
intersection of Calaveras Boulevard (Highway 237) at Milpitas on the Milpitas, Calif. U.S.G.S. map;
(9) Then it follows Highway 237 in a westerly direction approx. 7.2 miles to intersection of Bay Shore Freeway
(Highway 101) at Moffett Field on the Mt. View, Calif. U.S.G.S. map;
(10) Then in a northwest direction follow Bay Shore Freeway (Highway 101) for approx. 6.5 miles to the
intersection of the San Francisquito Creek (Santa Clara County/San Mateo County boundary) at Palo Alto T5S/R2W,
on the Palo Alto, Calif. U.S.G.S. map;
(11) Then it heads west on San Francisquito Creek (Santa Clara County/San Mateo County boundary) approx. 7
miles until it converges with Los Trancos Creek (Santa Clara County/San Mateo County boundary) near Bench Mark
172, approx. 100 feet east of Alpine Road;
(12) It travels south approx. 4 miles along Los Trancos Creek (Santa Clara County/San Mateo County boundary)
until it intersects the 600 foot elevation contour line at El Corte De Madera, approx. .5 mile north of Trancos Woods on
the Mindego Hill, Calif. U.S.G.S. map;
(13) It moves along the 600 foot elevation contour line in a southeasterly direction approx. 10 miles to Regnart
