Road at Regnart Creek on the Cupertino, Calif. U.S.G.S. map;
(14) It goes northeast along Regnart Road, approx. .7 mile to the 400 foot elevation contour line (.3 mile southwest
of Regnart School);
(15) It travels along the 400 foot elevation contour line southeast approx. 1.4 miles to the north section line of
Section 36, T7S/R2W at Blue Hills, CA;
(16) The boundary goes east on the section line approx. .4 mile to Saratoga Sunnyvale Road (Highway 85);
(17) It travels south on Saratoga Sunnyvale Road (Highway 85) approx. 1 mile to the south section line of Section
36, T7/8S R2W;
(18) Then it goes west on the section line approx. .75 mile to the first intersection of the 600 foot elevation contour
line;
(19) It follows the 600 foot elevation contour line southeast approx. .75 mile to Pierce Road south of Calabazas
Creek;
(20) It then travels south on Pierce Road approx. .4 mile to the first intersection of the 800 foot elevation contour
line;
(21) Then it runs southeast approx. 28 miles on the 800 foot elevation contour line to the east section line of Sec.
25, T10S/R2E/R3E approx. .5 mile north of Little Arthur Creek on the Mt. Madonna, Calif. U.S.G.S. map;
(22) Then it goes south on the section line approx. .5 mile to the 800 foot elevation contour line approx. .2 mile
south of Little Arthur Creek;
(23) Then it goes southeast along the 800 foot elevation contour line approx. 2.7 miles to Hecker Pass Road
(Highway 152) approx. 1.25 miles east of Hecker Pass on the Watsonville East, Calif. U.S.G.S. map;
(24) The boundary goes northeast on Hecker Pass Road (Highway 152) approx. .75 mile to the intersection of the
600 foot elevation contour line just west of Bodfish Creek;
(25) It travels southeast along the 600 foot elevation contour line approx. 7.3 miles to the first intersection of the
western section line of Sec. 30, T11S/R3E/R4E on the Chittenden, Calif. U.S.G.S. map;
(26) Then it follows south along the section line approx. 1.9 miles to the south township line at Sec. 31,
T11S/T12S, R3E/R4E;
(27) It moves in an easterly direction along the township line approx. 12.4 miles to the intersection of T11S/T12S
and R5E/R6E on the Three Sisters, Calif. U.S.G.S. map;
(28) Then it goes north along R5E/R6E range line approx. 5.3 miles to Pacheco Creek on the Pacheco Creek, Calif.
U.S.G.S. map;
(29) Then it moves northeast along Pacheco Creek approx. .5 mile to Elephant Head Creek at the point of
beginning.

